    "Fox",
    "Eagle",
    "Wolf",
    "Bear",
    "Lion",
    "Tiger",
    "Hawk",
    "Owl",
    "Deer",
    "Raven",
    "Falcon",
    "Lynx",
    "Otter",
    "Whale",
    "Shark",
    "Dolphin",
    "Phoenix",
    "Dragon",
    "Panther",
