// fs:/projects/nostrpop/src/hooks/useNostrPublish.ts
function useNostrPublish() {
  const { nostr } = n9();
  const { user } = useCurrentUser();
  return Se2({
    mutationFn: async (t27) => {
      if (user) {
        const tags = t27.tags ?? [];
        if (location.protocol === "https:" && !tags.some(([name]) => name === "client")) {
          tags.push(["client", location.hostname]);
        }
        const event = await user.signer.signEvent({
          kind: t27.kind,
          content: t27.content ?? "",
          tags,
          created_at: t27.created_at ?? Math.floor(Date.now() / 1e3)
        });
        await nostr.event(event, { signal: AbortSignal.timeout(5e3) });
        return event;
      } else {
        throw new Error("User is not logged in");
      }
    },
    onError: (error) => {
      console.error("Failed to publish event:", error);
    },
    onSuccess: (data) => {
      console.log("Event published successfully:", data);
    }
  });
}

